import React from 'react';
import s from '../../styles.module.css';

const Balance = () => (
  <section className={s.balance}>
    <span>⬆️2000$</span>
    <span>⬇️1000$</span>
    <span>Balance: 5000$</span>
  </section>
);

export default Balance;
